import React, { useEffect, useState } from 'react'
import todoLogo from '../assests/TodoLogo.svg'

export default function Register() {

    const [userCredentials, setUserCredentials] = useState({ username: '', password: '' })

    const handleInputsChange = (event) => {
        userCredentials[event.target.name] = event.target.value;
        setUserCredentials({ ...userCredentials })
        console.log(userCredentials.username)
    }

    return (
        <div className='container'>
            <div className='form-container'>
                <img src={todoLogo} className='brand-logo' />
                <div className='brand-title'>Register</div>
                <div className='inputs'>
                    <label className='label'>Username</label>
                    <input className='username-input' onChange={handleInputsChange} value={userCredentials.username} type='text' placeholder='Username' />
                    <label className='label'>Password</label>
                    <input className='password-input' onChange={handleInputsChange} value={userCredentials.password} type='password' placeholder='Password' />
                    <input type='submit' className='submit-button' />
                </div>
            </div>
        </div>
    )
}
